            "Five years later he became eligible to play for Namibia based on ancestry. He made his debut in the opening round of the T20 World Cup and helped his new team qualify for the Super 12s, winning two Player-of-the-Match awards on the way. Six months on, he was part of the Namibia side that won their first series against a Full Member when they beat Zimbabwe 3-2 in a T20I series in Bulawayo.",
            "An imposing allrounder, with the skills to take pace off the ball, and a strong lofted drive, Wiese was a late bloomer who came to prominence in the shorter formats. He began his career at Easterns and in 2005 established himself as a regular at the provincial union and the Titans franchise.",
