            "Born into a cricketing family - his uncle, father and brother are all cricketers - in Harare, Peter Moor has held a lifelong fascination for the game, taking it up aged just five. A product of the prestigious St John's College, Moor holds the record for the school's highest individual score, 214 not out. His talent as a wicketkeeper batsman was recognised young, and he was picked for the Zimbabwe Under-19 side as a 16 year old and represented them at two youth World Cups, in 2008 and 2010. ",
            "Moor initially struggled to nail down a regular place in Zimbabwean domestic franchise cricket, but he started to find his way in the 2013-14 season, having been mentored and coached by Grant Flower. An ODI debut against Bangladesh on Zimbabwe's ill-fated tour in November 2014 followed, and Moor forced his way into the Test side two years later, cracking 71 against New Zealand in his very first innings. ",
            "He developed into one of the more consistent batters on the domestic circuit, and in February 2019 was named vice-captain of Zimbabwe. But then his career took a twist. Having plied his trade in English and Irish club cricket as a young player and holding an Irish passport (his paternal grandmother was Irish), he went on to qualify for Ireland in October 2022 and debuted for them in Test cricket in Dhaka in April 2023, aged 32."
