        "bio": [
            "Chris Lynn was one of the first Australian players in his prime to turn his back on first-class cricket to become a white-ball specialist. It did not hinder his selection for Australia at T20I and ODI level but his inconsistency at international level saw him miss out on the 2019 World Cup after being seen as a potential asset for the previous 18 months. In 2018-19, he became the BBL's all-time leading run scorer and took over from Brendon McCullum as captain of the Brisbane Heat. ",
            "A prolific scorer when fully fit, Lynn had his run-marking severely curtailed in 2014-15 and 2015-16, suffering serious shoulder injuries in both years. In 2014 he had surgery on his left shoulder to fix a rotator cuff problem and missed the entire Matador Cup and the first half of the Sheffield Shield season. In 2015 a near identical scenario befell him when he injured his left shoulder during a fielding drill and missed the Matador Cup - in which he was to captain Queensland - and the first half of the Shield summer. The timing was unfortunate for Lynn, who in 2014 had made his T20 debut for Australia and missed opportunities to strengthen his international credentials. Still, when he was fit he was he scored heavily, including a 250 against eventual champions Victoria during the 2014-15 Sheffield Shield, and as the BBL's leading run scorer in 2015-16 with 378 at 54.00 and a strike-rate of 173."
        ],
