        "bio": [
            "A century in The Hundred and a six-wicket haul on Test debut, all in the space of four months in 2022. Of the predictions made early on in Will Jacks' career, the former was far more predictable than the latter. ",
            "The tall, clean-hitting batter was always spoken of as a limited-overs destroyer, putting the wider cricketing public on notice when, in 2019, he shot to mainstream attention with a 25-ball hundred in a T10 pre-season match against Lancashire in Dubai. When he struck 108 not out from 48 deliveries for Oval Invincibles against defending champions Southern Brave, there was awe but not much surprise. ",
            "There was, however, when he became the first England debutant spinner since 1993 to claim a five-wicket haul, with 6 for 161 in the first innings of the first Test against Pakistan at Rawalpindi, setting up a famous win. It was also the first time he had taken more than four in a first class innings. All the more remarkable given he wasn't expected to play in that match, only coming in before the toss after Surrey teammate Ben Foakes fell ill. ",
            "His selection on that tour was primarily for his off spin, which, while still raw, had been fashioned into something worthwhile by Gareth Batty. Surrey's head coach had noticed similarities between Jacks and Moeen Ali - another allrounder whose spin bowling had to be coaxed out of him - and gave him the responsibility of being the lead spin threat during the 2022 County Championship season. Returns were modest - 17 dismissals at 47 - but, coupled with 648 runs at an average of 54 from 11 appearances, he blossomed as a key member of a title-winning side. ",
            "Earmarked for a long time as a star-in-waiting. After a ton against India in an Under-19 Test in the 2017 summer, he went to the Under-19 World Cup in 2018 as vice-captain, where he hit 102 against Canada but largely struggled elsewhere.",
            "Jacks was one of a clutch of Surrey young guns who advanced their reputation during their Championship-winning season in 2018. Jacks made his debut in all three formats, at 19, and made a significant impression with a maiden county century against Gloucestershire at The Oval in the One-Day Cup, including four sixes in his 121 off 100 balls."
        ],
