            "Scotland left-arm spinner Mark Watt made a quiet international debut in 2015 but drew attention to himself more firmly two years on when he took five wickets against Netherlands in a T20I in Dubai, despatching them from 82 for 4 to nine down for less than 100. Later that year, he took three in a famous win against England in an ODI, Scotland's first. Watt won opportunities with Lancashire that summer, although he only took one wicket in four matches.",
            "He was instrumental in Scotland winning the Oman Quadrangular T20I Series in 2019, taking three wickets apiece in each of their two victories, over Ireland and Oman. Later that year, in the T20 World Cup Qualifier in the UAE, he took 12 wickets as Scotland went through to the event (which was deferred to 2021 due to Covid).",
            "When Scotland made a charge to the ODI World Cup Qualifiers in 2023, topping the table in the World Cricket League Division 2, Watt turned in crucial performances: in Aberdeen in 2022, he took 11 wickets in three games, against USA and UAE. He went a notch better in December that year and February 2023, when in seven games against Nepal and Namibia in Windhoek and Kirtipur, he took 20 wickets. Scotland ended up with 24 wins from their 36 games in the league. Watt played all but five of those ODIs, taking 54 wickets and finishing fourth on the WCL 2 wicket-takers' table for that cycle.\n"
