            "Batting allrounder Lewis Gregory has been one of the most consistent performers in the county game for Somerset, through the 2010s and beyond, despite injuries plaguing him for much of his career. ",
            "A one-time England Under-19 captain, he impressed sporadically until the 2014 season, when he began to produce regular performances with the ball across formats. That year he hit a 70-ball hundred in a List A game against Durham as a reminder of his promise with the bat.",
            "In the 2018 T20 Blast he made 328 runs at a strike rate of over 200, leading to an England call-up for the 2019 tour of New Zealand. That season he was appointed Somerset's T20 captain and turned in useful Championship runs and wickets in addition to his stellar hitting as a finisher in the Blast. He passed the 50-wickets mark in a first-class season for the first time the following year, when Somerset's title charge fell at the final hurdle. ",
            "Gregory made a decent start in the international 50-over game, making 40 and 77 against Pakistan in 2021, which helped England's Covid-depleted squad clinch a 3-0 whitewash. His T20I beginnings were rather less impressive, but Gregory won deals on the league circuit, playing in the Big Bash, the BPL, the PSL, and the SA20. He was the most successful captain across the first two seasons of the Hundred, leading Trent Rockets to the Eliminator in 2021, and hitting the winning runs in a low-scoring 2022 final.\n"
