            "A tall, imposing 140kph-plus fast bowler, Lungi Ngidi is as comfortable opening the bowling as he is at the death, and has been a regular presence in South Africa's sides, if not quite a shoo-in. ",
            "Ngidi played for Kwa-Zulu Natal Under-19s at the Khaya Majola week in 2014, where he was spotted by Northerns, moved upcountry to hone his skills at the University of Pretoria, and was identified as a T20 prospect when he was the joint second-highest wicket-taker in the provincial Africa Cup T20 tournament. He was promoted to Northerns' franchise team, Titans, for parts of their T20 campaign in 2015-16, played in the final, which they won, and was a central figure in their title defence the following season. ",
            "In January 2017, Ngidi made his T20I debut, against Sri Lanka, and was named Man of the Match on debut for his 2 for 12. A year later, he impressed even more on Test debut, blowing India's chase apart with 6 for 39 in the fourth innings in Centurion to take South Africa 2-0 up in the series. His debut ODI series followed, against the same opponent, and brought him eight wickets in three matches.",
            "Ngidi took a six-for in the second ODI of the clean sweep of Australia at home just before the pandemic hit. After more than a year out of Test cricket, he took seven wickets in two matches against Sri Lanka at home. He then toured Pakistan and West Indies before getting stuck into his favourite opponents, India, once again, taking eight wickets in Centurion in late 2021, though not in a win this time.\n"
