            "After making his first-class debut in 2010 at the age of just under 19, Nazmul had to take the long route to the senior side, compared to how many of Bangladesh cricketers stay in the BCB's system from the age-group playing years. His breakthrough season was 2013-14 when he took 31 wickets in the National Cricket League. However, he was always behind other left-arm spinners like Abdur Razzak, Enamul Haque jnr and Saqlain Sajib in the pecking order.",
