            "A nagging seamer, Alasdair Evans made his ODI debut against Canada in 2011, at the age of 20. Some impressive performances for Scotland in England's 40-over competition in 2012 earned him a contract with Derbyshire, who he played for in 2012 and 2013. But, although he performed well for the 2nd XI, he made little impact in the first team and was released after 2013. That summer he took 6 for 30 against Kenya in an Intercontinental Cup match. Evans played in the 2015 ODI World Cup, scoring 28 and taking two wickets in a narrow defeat to Afghanistan. He also played the T20 World Cups in 2016 and 2021."
