            "It may seem odd to talk of 2022 as a breakthrough year for Gus Atkinson given he only turned out for Surrey in four County Championship and six Vitality Blast matches. But there was evidently enough encouragement around his potential for the Desert Vipers to recruit him for the inaugural ILT20 at the start of 2023. ",
            "A connection between the Vipers and Hundred side Oval Invincibles helped - they share the same analytical team - but spells across his 10 appearances, with nine dismissals and an economy rate of 7.81, suggest it was a shrewd acquisition. His pace, along with a smooth run-up, was particularly noteworthy.",
            "A tall seamer educated at Bradfield College, Atkinson earned a professional contract in October 2017 after impressing for Surrey's second team throughout the previous summer. He performed creditably with the ball across the next two seasons, but without ever threatening to break into the first team - though an unbeaten hundred from No. 7 against Worcestershire in a Second XI game at the back end of 2018 hinted at a future as a bowling allrounder. He graduated to the 1st XI outright in 2020, with a List A debut coming in 2021. ",
