            "Andre McCarthy made his international bow for West Indies in 2018, as part of a weakened squad in Pakistan. He was handed the chance to add to his solitary cap three years later in Bangladesh, after being named in their ODI squad in similar circumstances.",
            "McCarthy represented West Indies in the 2006 Under-19 World Cup and spent many years toiling away on the regional circuit for Jamaica. He played a number of games for West Indies A in 2018, and then performed admirably in consecutive Regional Super50 seasons, finishing first and second on Jamaica's run charts in the 2018-19 and 2019-20 campaigns respectively.",
            "West Indies selector Roger Harper labelled him a \"scrapper\" and a \"fighter\" with a \"never-say-die\" attitude. A middle-order batsman, McCarthy also bowls offspin, taking a maiden five-wicket haul in February 2018."
