            "Far from being a one-dimensional player, he sets the fielding standards and can often be seen flinging himself around the outfield taking catches and trying to force run outs. While the work he puts in on his batting is yet to pay dividends, he hopes to be able to bat as high as 7 for Holland and contribute valuable runs in both forms of the game. ",
